import { useAuthContext } from "../hooks/useAuthContext"
import { useNavigate } from 'react-router-dom';

export const Reroute = () => {
    const navigate = useNavigate();
    const { user } = useAuthContext();

    if(!user) {
        navigate('/login')
        console.log('test')
    }
}
